import React from 'react'
import '../styles/AboutUs.scss'

function AboutUs() {
    return(
        <section className="aboutus-section">
            <h1 className="about-us-title">About Us</h1>
            <p className="about-us-description">
            Our family created with passion Nature Sculpt twenty years ago. Our passion for plants and trees made us decide to share our knowledge and skills with the public. Our team is composed of a landscaping architect, an agronomist, an irrigation expert, a garden maintenance specialist, a team of experienced gardeners and an administrative service.
            </p>
        </section>
    );
}

export default AboutUs
